{% block body %}
<div class=\"container\">
    <h1>Liste Users</h1>

    <p><a class=\"btn btn-primary btn-lg\" href=\"{{ path('user_new') }}\" role=\"button\">Ajout user</a></p>

    <table class=\"table\">
        <thead>
            <tr>
                <th>Id</th>
                <th>Email</th>
                <th>Roles</th>
                <th>NomComplet</th>
                <th>actions</th>
            </tr>
        </thead>
        <tbody>
        {% for user in users %}
            <tr>
                <td>{{ user.id }}</td>
                <td>{{ user.email }}</td>
                <td>{{ user.roles ? user.roles|json_encode : '' }}</td>
                <td>{{ user.nomComplet }}</td>
                <td>
                    <a href=\"{{ path('user_show', {'id': user.id}) }}\">Détail</a> | 
                    <a href=\"{{ path('user_edit', {'id': user.id}) }}\">Edit</a>
                </td>
            </tr>
        {% else %}
            <tr>
                <td colspan=\"7\">no records found</td>
            </tr>
        {% endfor %}
        </tbody>
    </table>
    
</div>
{% endblock %}
